import React, {Component} from 'react';
import {Route} from "react-router-dom"
import CollectionsOverview from "../../components/collections-overview/collection-overview.comopnent";
import CatgoryPage from "../collection/category.style.sass";


const ShopComponent =({match})=>{
    return (
            <div className='shop-page'>
               <Route exact path={`${match.path}`} component={ CollectionsOverview}/>
               <Route path={`${match.path}/:caaategoryId`} component={CatgoryPage}/>
            </div>
        );

}


export default ShopComponent;
